// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";

contract Accounts is AccessControlEnumerable {

  address public treasury;

  // Agent Data must be collected via admin chat and kept off-chain
  // tgid, name, phone, id card, selfie, location
  // Agents must use Telegram's Nearby People to advertise their service
  struct AccountStruct {
    address account;
    bool isAgent; // to enable/disable agent account
    uint256 commissions;
    bool isExcludedFromTransferFee;
    bool isBlacklisted;
  }
  // mappings are initialized automatically hence all possible keys already exists
  mapping(address => AccountStruct) accounts; // account => AccountStruct

  event BlacklistStatus(address user, bool flag);

  // Create a new role identifier for the role
  bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

  modifier onlyAgent {
    require(accounts[msg.sender].isAgent, "You are not an agent.");
    _;
  }

  constructor() {
    // IMPORTANT: on deployment exclude treasury from fees
    _setupRole(ADMIN_ROLE, msg.sender);
    treasury = msg.sender;
    accounts[treasury].isExcludedFromTransferFee = true;
  }

  function addAdmin(address admin) external onlyRole(ADMIN_ROLE) {
    _grantRole(ADMIN_ROLE, admin);
  }

  function removeAdmin(address admin) external onlyRole(ADMIN_ROLE) {
    if (admin != treasury) {
      _revokeRole(ADMIN_ROLE, admin);
    }
  }

  function getAccount(address user) external view returns(AccountStruct memory) {
    return accounts[user];
  }

  function updateCommissions(address user, uint256 amount) external onlyRole(ADMIN_ROLE) {
    accounts[user].commissions += amount;
  }

  function toggleIsBlacklisted(address user) external onlyRole(ADMIN_ROLE) {
    accounts[user].isBlacklisted = !accounts[user].isBlacklisted;
    emit BlacklistStatus(user, accounts[user].isBlacklisted);
  }

  function isBlacklisted(address user) external view returns (bool) {
    return accounts[user].isBlacklisted;
  }

  function getCommissions() external view onlyAgent returns (uint256) {
    return accounts[msg.sender].commissions;
  }

  // add agent for commissions and fees exception
  function registerAgent(address agent) external onlyRole(ADMIN_ROLE) {
    accounts[agent].account = agent;
    accounts[agent].isAgent = true;
  }

  function toggleIsAgent(address agent) external onlyRole(ADMIN_ROLE) {
    accounts[agent].isAgent = !accounts[agent].isAgent;
  }

  function isAgent(address agent) external view returns (bool) {
    return accounts[agent].isAgent;
  }

  function toggleIsExcludedFromTransferFee(address account) external onlyRole(ADMIN_ROLE) {
    accounts[account].isExcludedFromTransferFee = 
      !accounts[account].isExcludedFromTransferFee;
  }

  function isExcludedFromTransferFee(address account) external view returns (bool) {
    return accounts[account].isExcludedFromTransferFee;
  }

}
